  [],\n\t\"revision_timestamp\": \"2016-08-04T08:17:25.326490\",\n\t\"name\": \"selawik-national-wildlife-refuge-annual-narrative-report-calendar-year-1984\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Selawik
  National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the master plan. Refuge administration is outlined; information about personnel,
  youth programs, manpower programs, volunteer programs, funding, and safety is given.
  Habitat management is also covered; subjects include wetlands, croplands, grazing,
  and fire management. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
  raptors, game mammals, marine mammals, and fisheries resources. The public uses
  of the Refuge described in this report include interpretive programs, hunting, fishing,
  trapping, and wildlife observation. The equipment and facilities section of the
  report provides information about new construction, equipment replacement, and communication
  systems.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
